import "../Styles/nav.css";

function Navbar() {
  return (
    <div className="navHolder">
      <img src="https://via.placeholder.com/60"
        alt="icon" />
      <div>Shareable WhiteBoard</div>
    </div>
  );
}

export default Navbar;
